import React from 'react';
import './Faculty.css';

function Faculty() {
  const faculty = [
    { id: 1, name: 'Dr. Vishwas Rao', image: '/images/faculty1.jpg', description: 'He has so much experience in web development.' },
    { id: 2, name: 'Prof. Silky Goel', image: '/images/faculty2.jpg', description: 'She is going to teach you AIML.' },
    { id: 3, name: 'Dr. Shahina Anwarul', image: '/images/faculty3.jpg', description: 'She is going to teach you Data Science.' },
  ];

  return (
    <div className="faculty">
      <h2>Faculty Information</h2>
      <div className="faculty-list">
        {faculty.map((member) => (
          <div key={member.id} className="faculty-card">
            <div className="image-container">
              <img src={member.image} alt={member.name} />
              <div className="overlay">
                <p>{member.description}</p>
              </div>
            </div>
            <p className="faculty-name">{member.name}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Faculty;
